const BookList = ({ books }) => {
	return (
		<div className="book-list">
      <div className="book">
    			{books.map((book) => (
    				<td>
              <img className="book-cover" src={book.image}/>
      				<p><i>{book.title}</i></p>
              <p>by {book.author}</p>
      				<p>{book.rating}</p>
            </td>
    			))}
        </div>
    </div>
	);
};

export default BookList;
